    "invasive-plant-species-and-area-prioritization-report-guadalupe-nipomo-dunes-complex",nt"isopen":
    false,nt"url": null,nt"notes": "On July 20-21, 2015 a workshop was held
    near the Guadalupe-Nipomo Dunes National Wildlife Refuge (GND NWR) with members
    of the Dunes Collaborative, a partnership between federal, state, private, and non-profit
    organizations committed to restoration of the Guadalupe-Nipomo Dunes Complex. The
    Land Conservancy of San Luis Obispo County (The Land Conservancy) and the San Luis
    Coastal Resource Conservation District (SLCRCD) hosted the workshop, which was led
    by Utah State University (USU). Participants in the workshop included USU, the refuge,
    The Land Conservancy, California State and County parks, SLCRCD, and California
    Polytechnic University; a full list of participants is found in Table 1. Earlier
    in 2015, the Guadalupe-Nipomo Dunes NWR received a grant to conduct an invasive
    species inventory. The purpose of the workshop was to prioritize target invasive
    species and areas to direct inventory objectives and methods selection. The inventory
    will be conducted in February 2016 with oversight by the Land Conservancy.",nt"license_title":
